import React from 'react';
import Jumbotron from '../Jumbotron';

const Header = () => {
  return (
    <Jumbotron>
      <h1>Steadfast</h1>
      <p>Find contacts and leads fast. Get back to business.</p>
      <p>
        <Button variant="primary">Get Started</Button>
      </p>
    </Jumbotron>
  );
};
export default Header;
